import React,{Component} from 'react';
import './Frame .css'
import {
    BrowserRouter as Router,
     Link,Route
  } from "react-router-dom";
  import Product from ''
class Frame extends Component{
    constructor (props) {
        super(props)
        this.state = {
          anh :'http://localhost:4000/anh/' + this.props.anh
        
        }
     }
     
    render(){
        return(
           <Router>
                <Link className="frame">
                    <img className="sizeimg"  src={this.state.anh}  ></img>
                    <p>{this.props.ten} </p>
                    <b>{this.props.gia}</b>
                </Link>
                {/* <Route path="/shirt/aaa" exact component={Home} /> */}
                <Route path="/login/ksCT" exact render={props => <Product {...props} ten={this.state.ten}  />} />
            </Router>
        )
}}
export default Frame
